import React from 'react'; 
import "./App.css";
import logo from './bong.png';

function App(props) {
    const sayHello = () => {
        console.log("Click Here if that's cool with you");

    }

    

    return (
        <div className="App">
         
   
            <h1>
                Hello world
                </h1>
            <p> can you do me a solid and please don't drop the: </p>

          

            <button onClick={sayHello}> Click Here If that's Cool With You</button>
            
    
        </div>
        )
}


export default App;
